import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to trigger the profile view
    // Using a text-based selector to find the link
    const profileLink = page.locator('a:has-text("Your Profile")').first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_profile_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_profile_click.png'));

    // Wait for the profile page content to be rendered by the script
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();
    const totalOrders = await page.locator('.stat:has-text("Orders") .stat-number').textContent();
    const totalReviews = await page.locator('.stat:has-text("Reviews") .stat-number').textContent();
    const sellerRating = await page.locator('.stat:has-text("Seller Rating") .stat-number').textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      stats: {
        orders: parseInt(totalOrders.trim(), 10),
        reviews: parseInt(totalReviews.trim(), 10),
        sellerRating: parseFloat(sellerRating.trim())
      }
    };

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_harvested.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_harvested.png'));

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
